!function(e){e.PluginManager.add("cce_mce_hr_button",function(e,t){e.addButton("cce_mce_hr_button",{icon:"hr",tooltip:"Horizontal line",onclick:function(){e.windowManager.open({title:"Insert Horizontal Line",body:[{type:"listbox",name:"hr",label:"Style",values:[{text:"Plain",value:"cce-divider--plain"},{text:"Strong",value:"cce-divider--strong"},{text:"Double",value:"cce-divider--double"},{text:"Dashed",value:"cce-divider--dashed"},{text:"Dotted",value:"cce-divider--dotted"}]}],onsubmit:function(t){e.insertContent('<hr class="cce-divider '+t.data.hr+'" />')}})}})})}(tinymce);